import React from "react";
import { Alert, Container, Row, Col, Card, CardTitle, CardHeader, CardBody, CardImg , Button, Modal, ModalBody, ModalHeader} from "shards-react";
import { Form, FormInput, FormGroup } from "shards-react";
import { FaSkype, FaSlackHash, FaWhatsapp, FaSms, FaMailBulk, FaSlack, FaPhone, FaArrowRight } from 'react-icons/fa';
import { ListGroup, ListGroupItem, ListGroupItemHeading } from "shards-react";


class Course extends React.Component
{


  render() {


    return(
        <Container>

      <Row style={{ paddingTop: "10px" }}>

      <Col sm="12" md="4" lg="3">

      <ListGroup>
      <ListGroupItem><strong>Course Content</strong></ListGroupItem>

      <ListGroupItem><a>Cras justo odio</a></ListGroupItem>
      <ListGroupItem>Dapibus ac facilisis in</ListGroupItem>
      <ListGroupItem>Morbi leo risus</ListGroupItem>
      <ListGroupItem>Porta ac consectetur ac</ListGroupItem>
      <ListGroupItem>Vestibulum at eros</ListGroupItem>

    </ListGroup>
        </Col>

        <Col sm="12" md="8" lg="9">
          <Card> 
            <CardHeader><strong>Course </strong></CardHeader>

            <CardBody>
            <CardTitle>Cyber Security Course for Beginners - Level 01</CardTitle>




            </CardBody>
          </Card>
        </Col>



      </Row>


    </Container>

    )
  }
}

export default Course;
